import React from 'react'
import styles from './index.module.css'



interface TabsNavProps {
    onChange: Function;
    focusesAndTypesOfSkillsArr: Object[];
}

const TabsNav = (props: TabsNavProps) => {
    let TabsNavItems = [];

    const focusesAndTypesOfSkillsArr = props.focusesAndTypesOfSkillsArr

    for(let i = 0; i < focusesAndTypesOfSkillsArr.length; i++) {
        console.log(Object.keys(focusesAndTypesOfSkillsArr[i]))
    }

    // props.focusesAndTypesOfSkillsArr.forEach(focusOfSkill => {
    //     console.log(Object.keys)
    //     TabsNavItems.push(
    //     // <li>
    //     //     <button onClick={handleChange} className={`${styles.button_tag}`}>
    //     //     </button>
    //     // </li>
    //     )
    // })

    const handleChange = (event: any) => {
        props.onChange(event.target.value);
    }

  return (
    <div className={styles.main_menu}>
        <h2 className={styles.mySkills_title}>My skills</h2>
        <div>
            <h4 className={styles.skill_type}>
                HARD
            </h4>
            <ul className={styles.tag_list}>
                <li>
                    <button onClick={handleChange} className={`${styles.button_tag}`} value='Frontend'>
                        Frontend
                    </button>
                </li>
                <li>
                    <button onClick={handleChange}  className={styles.button_tag} value='Backend'>
                        Backend
                    </button>
                </li>
                <li>
                    <button onClick={handleChange}  className={styles.button_tag} value='Another skills'>
                        Other skills
                    </button>
                </li>
            </ul>
        </div>
        <div>
            <h4 className={styles.skill_type}>
                SOFT
            </h4>
            <ul className={styles.tag_list}>
                <li>
                    <button onClick={handleChange}  className={styles.button_tag} value='Social skills'>
                        Social skills
                    </button>
                </li>
                <li>
                    <button onClick={handleChange}  className={styles.button_tag} value='Foreign languages'>
                        Foreign languages
                    </button>
                </li>
                <li>
                    <button onClick={handleChange}  className={styles.button_tag} value='Buisness skills'>
                        Buisness skills
                    </button>
                </li>
                <li>
                    <button onClick={handleChange}  className={styles.button_tag} value='Intellectual skills'>
                        Intellectual skills
                    </button>
                </li>
            </ul>
        </div>
    </div>
  )
}

export default TabsNav
